const sitemapXmlRefToValidate = [{
  key: "lbo",
  url: `${expectedDomainByStore.lbo}/flux/sitemap.xml`
}, {
  key: "ryses_es",
  url: `${expectedDomainByStore.ryses_es}/flux/sitemap.xml`
}, {
  key: "ryses_it",
  url: `${expectedDomainByStore.ryses_it}/flux/sitemap.xml`
}];
sitemapXmlRefToValidate.forEach(({
  key,
  url
}) => {
  parseSitemap(url).then(sitemapUrls => {
    cy.wrap(sitemapUrls).each(sitemapUrl => {
      if (sitemapUrl.endsWith('.xml')) {
        parseSitemap(sitemapUrl).then(childUrls => checkUrls(childUrls, key));
      } else {
        checkUrls([sitemapUrl], key);
      }
    });
  }).then(() => {
    if (failedUrls[key].length > 0) {
      cy.log(`Broken or invalid URLs found for ${key}:`);
      failedUrls[key].forEach(url => cy.log(url));
    }
    expect(failedUrls[key]).to.be.empty;
  });
});
